import React from 'react';

function List({ contacts }) {
    return (
        <div>

            <input placeholder="filter contact" />

            <ul>
                {contacts.map((contact, index) => (
                    <li key={index}> {contact.fullname}</li>
                ))}
            </ul>
        </div>
    );
}

export default List;
